//MARK: hash查重
extension SolutionHash {
    func containsDuplicate(_ nums: [Int]) -> Bool {
        var set = Set<Int>()
        for num in nums {
            if set.contains(num) {
                return true
            }
            set.insert(num)
        }
        return false
    }
}

//MARK: 只出现过一次的数字
extension SolutionHash {
    func singleNumber(_ nums: [Int]) -> Int {
        var result = 0
        for num in nums {
            result = result ^ num
        }
        return result
    }
}

//MARK: 两个数组的交集
extension SolutionHash {
    func intersection(_ nums1: [Int], _ nums2: [Int]) -> [Int] {
        let set = Set<Int>(nums1)
        var array = [Int]()
        for num in nums2 {
            if set.contains(num) && !array.contains(num) {
                array.append(num)
            }
        }
        return array
    }
}

//MARK: 快乐数
extension SolutionHash {
    func isHappy(_ n: Int) -> Bool {
        var hash = Set<[Int]>()
        
        var nums = separateNum(n)
        
        while true {
            if hash.contains(nums) {
                return false
            } else {
                hash.insert(nums)
            }
            
            var sum = 0
            for num in nums {
                sum += num * num
            }
            
            if sum == 1 {
                return true
            }
            
            nums = separateNum(sum)
        }
    }
    
    func separateNum(_ num: Int) -> [Int] {
        var nums = [Int]()
        var num = num
        while num != 0 {
            nums.append(num % 10)
            num /= 10
        }
        if nums.count == 0 {
            nums.append(0)
        }
        return nums.sorted()
    }
}


//MARK: 两数之和
extension SolutionHash {
    func twoSum(_ nums: [Int], _ target: Int) -> [Int] {
        var hash = [Int: Int]()
        for index in 0 ..< nums.count {
            hash[nums[index]] = index
        }
        for index in 0 ..< nums.count {
            if let index1 = hash[target - nums[index]], index != index1 {
                return [index1, index].sorted()
            }
        }
        return []
    }
}

//MARK: 同构字符串
extension SolutionHash {
    func isIsomorphic(_ s: String, _ t: String) -> Bool {
        print(Date())
        guard s.count == t.count else {
            return false
        }
        
        var hash1 = [Character: Int]()
        var hash2 = [Character: Int]()
        
        for index in 0 ..< s.count {
            let strIndex1 = s.index(s.startIndex, offsetBy: index)
            let strIndex2 = t.index(t.startIndex, offsetBy: index)
            let char1 = s[strIndex1]
            let char2 = t[strIndex2]

            let index1 = hash1[char1]
            let index2 = hash2[char2]
            
            if index1 == index2 {
                hash1[char1] = index
                hash2[char2] = index
            } else {
                return false
            }
        }
        print(Date())

        return true
    }
}
